import React from 'react';

const Home = () => {
    return(
        <div className="p-6">
            <h1 className="text-3xl font-bold text-main1 mb-4">الرئيسية</h1>
            <p className="text-gray-600">مرحباً بك في لوحة التحكم</p>
        </div>
    );
}

export default Home;
